      .container1 {
        height: 1000px;
        width: 100vw;
        align-items: center;
        justify-content: center;
        display: block;
      }
      #titulo {
        align-items: center;
        justify-content: center;
        display: flex;
        margin-top: 20vh;
        color: #000000c9;
        font-size: 5vw;
        background: linear-gradient(
          135deg,
          rgba(219, 219, 219, 0.432),
          rgba(116, 116, 116, 0.495)
        );
        margin-inline: 15vw;
        border-radius: 30px;
      }
      .container2 {
        display: grid;
        grid-template-columns: repeat(auto-fit, minmax(20vw, 1fr));
        gap: calc(70px + 1vw);
        padding: 5vw; /* padding relativo  tela */
        margin-top: 50vh; /* menor que antes */
        background: linear-gradient(135deg, rgb(40, 40, 45), rgb(0, 0, 0));

        backdrop-filter: blur(10px);
        justify-items: center;
      }
      #cell3 img {
        filter: brightness(2);
      }
      .cell {
        box-shadow: 5px 10px 10px rgb(0, 0, 0);
        background: linear-gradient(135deg, rgba(49, 49, 49, 0), rgb(0, 0, 0));
        background-color: rgb(49, 49, 49, 0.961);
        display: flex;
        justify-content: center;
        align-items: center;
        flex-direction: column;
        overflow: hidden;

        text-align: center;
        box-sizing: border-box;
        width: 40vw; /* antes era 170px */
        height: 40vw; /* proporcional  largura da tela */
        max-width: 375px; /* no fica gigante em telas grandes */
        max-height: 19vh;
        border-radius: 4vw;
        border: solid rgb(37, 37, 37);
        border-left: solid #494949 0.25vw;
        border-top: solid #494949 0.25vw;
        transition: 0.4s;
        user-select: none;
        cursor: pointer;
        user-select: none;
        -webkit-user-select: none;
        -webkit-tap-highlight-color: transparent;
      }
      .cell:hover {
        background-color: #6b6b6b;
      }
      .cell:active {
        background-color: white;
        transform: scale(1.05);
        transition: none;
      }
      a {
        width: 100%;
        height: 100%;
      }
      .cell img {
        max-width: 70%;
        max-height: 70%;
        margin-top: 20px;
      }
      .cell-header img {
        max-width: 100%;
        max-height: 100%;
        background-color: #ffffff6c;
        border-radius: 40px;
        padding-inline: 5vw;
      }

      .logo {
        background-color: #ffffff00;
        margin-left: 5vw;
      }

      .cell-header {
        width: 90%;
        height: 10vh;
        background-color: #ffffff2d; /* Cor de fundo cinza claro */
        position: fixed;
        z-index: 1000;
        display: flex;
        backdrop-filter: blur(20px);
        border-radius: 60px;
        margin-inline: 5vw auto;
        padding-top: 10px;
        padding-bottom: 10px;
      }

      /* Clula do Facebook */

      /* Clula do Uber */

      /* Clula "Sem Internet" */

      /* Clula SOS */

      .menu-hamburguer {
        position: relative;
        right: 60px;
      }

      .menu-icon {
        position: absolute;
        top: 30px;
        left: 25px;
        cursor: pointer;
      }
      .menu-icon span {
        display: block;
        width: 30px;
        height: 3px;
        background-color: #ffffff;
        margin-bottom: 5px;
      }

      .menu {
        position: absolute;
        top: 10px;
        left: 0px;
        background-color: #000000;
        padding: 0px 5px 10px 5px;
        border: 1px solid #dddddd00;
        transition: 1s;
        display: block;
      }
      .menu li {
        margin-top: -20px;
        transition: 1s;
      }
      #menu-toggle:checked ~ .menu li {
        margin-top: 10px;
      }
      .menu a {
        row-gap: 100px;
        display: block;
        color: rgba(255, 255, 255, 0.96);
        text-decoration: none;
        transition: 1s;
      }

      #menu-toggle:checked ~ .menu {
        display: block;
        position: absolute;
        top: 10px;
        color: #000000;
        left: 0px;
        background-color: #000000;
        padding: 50px 5px 10px 5px;
        border-inline: 1px solid #ffffff;
        border-bottom: 1px solid #ffffff;
        border-radius: 0 0 10px 10px;
      }
      #menu-toggle:checked ~ .menu a {
        color: #fcfcfc;
      }
      input {
        display: none;
      }

      #menu-toggle:checked ~ .menu-icon #one {
        transform: rotateZ(45deg);
        transform-origin: 0px 6px;
        transition: 0.75s;
      }
      #menu-toggle:checked ~ .menu-icon #two {
        transform: rotateZ(-45deg);
        transform-origin: 20px 5px;
        transition: 0.75s;
      }
      #menu-toggle:checked ~ .menu-icon #t span {
        background-color: rgba(255, 0, 0, 0);

        transition: 0.75s;
      }

      .menu-icon span,
      .menu-icon div {
        transition: 0.75s;
      }

      /* SOS boto */

      /* Tela dos telefones */
      #telefones {
        display: none;
        text-align: center;
        color: white;
        background-color: #000000;

        width: 100vw;
        height: 100vh;
      }
      #telefones h1 {
        color: #ff4444;
        font-size: 2em;
        margin-top: 50px;
      }
      #telefones .telefone {
        font-size: 1.5em;
        margin: 20px 0;
      }
      #voltar {
        background-color: #00bfff;
        color: white;
        border: none;
        padding: 15px 30px;
        border-radius: 10px;
        font-size: 1em;
        cursor: pointer;
        margin-top: 30px;
      }
      #voltar:hover {
        background-color: #0099cc;
      }
    </style>
  </head>

    <div class="container1" id="principal">
      <header class="cell-header">

      <div class="telefone"> Polcia: <strong>190</strong></div>
      <div class="telefone"> Bombeiros: <strong>193</strong></div>

      <button id="voltar" onclick="voltar()"> Voltar</button>

    <script>
      function mostrarTelefones() {
        setTimeout(() => {
          document.getElementById("principal").style.display = "none";
        }, 300);
        setTimeout(() => {
          document.getElementById("telefones").style.display = "block";
        }, 300);
      }
      function voltar() {
        setTimeout(() => {
          document.getElementById("principal").style.display = "block";
        }, 300);
        setTimeout(() => {
          document.getElementById("telefones").style.display = "none";
        }, 300);
      }

      if ("serviceWorker" in navigator) {
        navigator.serviceWorker
          .register("service-worker.js")
          .then(() => console.log("Service Worker registrado!"))
          .catch((err) =>
            console.log("Falha ao registrar o Service Worker:", err)
          );
      }
    </script>
